import { AppBar, Toolbar, Typography, styled, InputBase, IconButton, Menu, MenuItem, Button, Fade } from '@mui/material'
import ShoppingBagTwoToneIcon from '@mui/icons-material/ShoppingBagTwoTone';
import React, { useState } from 'react'
import Badge from '@mui/material/Badge';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import PersonIcon from '@mui/icons-material/Person';
import FavoriteIcon from '@mui/icons-material/Favorite';

const StyledToolBar = styled(Toolbar)({
    display: "flex",
    justifyContent: "space-between",
    backgroundColor: "#f27a1a",
});
const Items = styled(Toolbar)({
    display: "flex",
    justifyContent: "space-between",
    backgroundColor: "#f27a1a",

});
const Search = styled("div")(({ theme }) => ({
    backgroundColor: "white",
    padding: "0 10px",
    borderRadius: theme.shape.borderRadius,
    width: "20%"
}));
const Icons = styled("box")(({ theme }) => ({
    display: "none",
    alignItems: "center",
    gap: "20px",
    color: "white",
    [theme.breakpoints.up("sm")]: {
        display: "flex"
    }
}));
const StyledBadge = styled(Badge)(({ theme }) => ({
    '& .MuiBadge-badge': {
        right: -3,
        top: 13,
        border: `2px solid ${theme.palette.background.paper}`,
        padding: '0 4px',
    },
}));

export const Navbar = () => {
    const [anchorEl, setAnchorEl] = React.useState(null);
    const open = Boolean(anchorEl);
    const handleClick = (event) => {
        setAnchorEl(event.currentTarget);
    };
    const handleClose = () => {
        setAnchorEl(null);
    };
    return (
        <AppBar position='sticky'>
            <StyledToolBar>
                <Typography variant='h6' sx={{ display: { sx: "none,", sm: "block" } }}>
                    CATER PÄ°E
                </Typography>
                <ShoppingBagTwoToneIcon sx={{ display: { xs: "block", sm: "none" } }} />
                <Search><InputBase placeholder='search..' /></Search>
                <Icons>
                    <IconButton aria-label="cart">
                        <StyledBadge color="secondary">
                            <FavoriteIcon />
                            <Typography>Favorilerim</Typography>
                        </StyledBadge>
                    </IconButton>
                    <IconButton aria-label="cart">
                        <StyledBadge color="secondary">
                            <ShoppingCartIcon />
                            <Typography>Sepetim</Typography>
                        </StyledBadge>
                    </IconButton>

                    <IconButton 
                    aria-label="cart">
                      
                        <StyledBadge color="secondary">
                            <PersonIcon  />
                            <Typography >GiriÅ Yap</Typography>


                        </StyledBadge>
                    </IconButton>

                </Icons>


            </StyledToolBar>
            <Items>
                <Button startIcon color='inherit'
                    id="kadin_giyim"
                    aria-controls={open ? 'kadin_giyim' : undefined}
                    aria-haspopup="true"
                    aria-expanded={open ? 'true' : undefined}
                    onClick={handleClick}
                >
                    KadÄ±n Giyim

                </Button>
                <Button
                    color='inherit'
                    id="fade-button"
                    aria-controls={open ? 'erkek_giyim' : undefined}
                    aria-haspopup="true"
                    aria-expanded={open ? 'true' : undefined}
                    onClick={handleClick}
                >Erkek Giyim</Button>
                <Button color='inherit'
                    id="fade-button"
                    aria-controls={open ? 'ayakkabi_canta' : undefined}
                    aria-haspopup="true"
                    aria-expanded={open ? 'true' : undefined}
                    onClick={handleClick}>
                    AyakkabÄ±&Ã§anta
                </Button>
                <Button color='inherit'
                    id="fade-button"
                    aria-controls={open ? 'elektronik' : undefined}
                    aria-haspopup="true"
                    aria-expanded={open ? 'true' : undefined}
                    onClick={handleClick}>
                    elektronik
                </Button>
                <Button color='inherit'
                    id="fade-button"
                    aria-controls={open ? 'spor_outdoor' : undefined}
                    aria-haspopup="true"
                    aria-expanded={open ? 'true' : undefined}
                    onClick={handleClick}>
                    Spor&outdoor
                </Button>
                <Button color='inherit'
                    id="fade-button"
                    aria-controls={open ? 'Ã§ok_satanlar' : undefined}
                    aria-haspopup="true"
                    aria-expanded={open ? 'true' : undefined}
                    onClick={handleClick}>
                    Ã§ok satanlar
                </Button>


            </Items>
            <Menu
                id="kadin_giyim"
                MenuListProps={{
                    'aria-labelledby': 'kadin_giyim',
                }}
                anchorEl={anchorEl}
                open={open}
                onClose={handleClose}
                TransitionComponent={Fade}
            >
                  <Button startIcon color='inherit'
                    id="kadin_giyim"
                    aria-controls={open ? 'kadin_giyim' : undefined}
                    aria-haspopup="true"
                    aria-expanded={open ? 'true' : undefined}
                    onClick={handleClick}
                >
                    KadÄ±n Giyim

                </Button>
                <MenuItem onClick={handleClose}>Giyim</MenuItem>
                <MenuItem onClick={handleClose}>Ãanta</MenuItem>
                <MenuItem onClick={handleClose}>AyakkabÄ±</MenuItem>

            </Menu>

            <Menu
                id="erkek_giyim"
                MenuListProps={{
                    'aria-labelledby': 'fade-button',
                }}
                anchorEl={anchorEl}
                open={open}
                onClose={handleClose}
                TransitionComponent={Fade}
            >
                

            </Menu>
            <Menu
                id="ayakkabi_canta"
                MenuListProps={{
                    'aria-labelledby': 'fade-button',
                }}
                anchorEl={anchorEl}
                open={open}
                onClose={handleClose}
                TransitionComponent={Fade}
            >
               

            </Menu> <Menu
                id="elektronik"
                MenuListProps={{
                    'aria-labelledby': 'fade-button',
                }}
                anchorEl={anchorEl}
                open={open}
                onClose={handleClose}
                TransitionComponent={Fade}
            >
               

            </Menu> <Menu
                id="spor_outdoor"
                MenuListProps={{
                    'aria-labelledby': 'fade-button',
                }}
                anchorEl={anchorEl}
                open={open}
                onClose={handleClose}
                TransitionComponent={Fade}
            >
                

            </Menu> <Menu
                id="Ã§ok_satanlar"
                MenuListProps={{
                    'aria-labelledby': 'fade-button',
                }}
                anchorEl={anchorEl}
                open={open}
                onClose={handleClose}
                TransitionComponent={Fade}
            >
                
            </Menu>
            <Menu
                id="giris_yap"
                MenuListProps={{
                    'aria-labelledby': 'fade-button',
                }}
                anchorEl={anchorEl}
                open={open}
                onClose={handleClose}
                TransitionComponent={Fade}
            >
               

            </Menu>

        </AppBar>
    )
}
